(13, 1496989657, '<p style="text-align: center;"><span style="font-size: 20px;"><strong>财政预算单位公务卡</strong></span></p><p><span style="font-size: 36px;"><strong><span style="font-size: 20px;"></span></strong></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">一、产品标准定义&nbsp; </span></strong></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><span style="font-family: 宋体">财政预算单位公务卡，是指预算单位根据需要要求其工作人员持有的，主要用于日常公务支出和财务报销业务兼具个人消费功能的信用卡。</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体"><span style="font-size: 14px">二、业务特点与优势</span></span></strong></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><span style="font-family: 宋体">中国建设银行是国内四大国有独资商业银行中率先实现海外上市的大型国有股份制商业银行，也是国内最大最强的信用卡发卡银行之一，在中国银行业居于市场领先地位。</span><span style="font-family: 宋体">我行</span><span style="font-family: 宋体">专门推出的财政预算单位公务卡，是符合财政部、人民银行公务卡管理制度的要求、为广大财政预算单位工作人员度身定制的标准信用卡，既具有一般信用卡的授信消费等共同属性，同时又具有财政财务管理的独特属性。与国内同类产品相比，我行的公务卡产品具备了明显的“功能优势、服务优势、价格优势”，能够全面满足财政预算单位员工的日常公务支出和个人正常消费。配套使用我行为财政预算单位提供的“公务卡报销支持系统”，可以简化报销用款流程，减少单位日常现金用量，有效提升预算单位财务报销效率，有助于进一步辅助预算单位加强财务管理。</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体"><span style="font-size: 14px">三、产品服务对象&nbsp; </span></span></strong></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-family: 宋体"><span style="font-size: 14px">各级预算单位及其在职在编工作人员</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">四、币种和期限</span></strong></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-family: 宋体"><span style="font-size: 14px">人民币信用卡</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-family: 宋体"><span style="font-size: 14px">有效期3年</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">五、服务价格</span></strong></span></p><p style=";text-align: left;line-height: 31px;-ms-layout-grid-mode: char"><span style="font-family: 宋体;font-size: 14px">中国建设银行财政预算单位公务卡收费项目及标准</span></p><table width="100%"><tbody><tr class="firstRow" style="height: 37px"><td style="padding: 0px 7px; border: 1px solid windowtext; background-color: transparent;" width="16"><p style=";text-align: center;line-height: 31px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体;-ms-layout-grid-mode: line"><span style="font-size: 14px">收费项目</span></span></strong></p></td><td style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: windowtext windowtext windowtext rgb(236, 233, 216); padding: 0px 7px; background-color: transparent;" width="53"><p style=";text-align: center;line-height: 31px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体;-ms-layout-grid-mode: line"><span style="font-size: 14px">收 费 标 准</span></span></strong></p></td><td style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: windowtext windowtext windowtext rgb(236, 233, 216); padding: 0px 7px; background-color: transparent;" width="29"><p style=";text-align: center;line-height: 31px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体;-ms-layout-grid-mode: line"><span style="font-size: 14px">备&nbsp;&nbsp;&nbsp; 注</span></span></strong></p></td></tr><tr style="height: 64px"><td style="border-width: medium 1px 1px