y: 宋体">&nbsp; </span><span style="font-family: 宋体">宣传上门、办卡上门、系统安装上门、培训上门、优惠服务上门，客户经理提供全程贴心服务</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享金卡额度</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">彰显不凡身份，尽享金卡礼遇</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享特惠商户</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">一万家特惠商户，让您时刻体验贵宾礼遇</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享团购分期</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">度身定制专享数码、汽车等各类团购优惠分期及商场、邮购消费、现金等分期付款服务</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享缤纷促销</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">专享我行专门组织安排的促销活动，享受更多优惠和便利</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享客服优先</span></strong><span style="font-family: 宋体">&nbsp; 800</span><span style="font-family: 宋体">客服热线优先受理，消费争议款项优先处理，提供VIP周到服务</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享高额保险</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">指定商户刷卡购机票，可获赠金卡100万，普卡50万高额航空意外保险</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享短信提醒</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">交易提醒短信，用卡安全有保障；账单到期（到期日前3天）提醒短信，确保及时还款；还款确认短信，资金入账更安心</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享便捷还款</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">公务用款自动批量入账，省却报销繁杂流程</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">专享安全保障</span></strong><span style="font-family: 宋体">&nbsp; </span><span style="font-family: 宋体">消费信息查询限定于公务支出，保障个人消费隐私</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><strong><span style="font-family: 宋体">八、关联产品</span></strong><span style="font-family: 宋体">&nbsp; </span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-family: 宋体"><span style="font-size: 14px">财政授权支付业务 信用卡 网上银行</span></span></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><strong><span style="font-family: 宋体"><span style="font-size: 14px">九、客户流程</span></span></strong></p><p style=";text-align: left;line-height: 31px;text-indent: 28px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><span style="font-family: 宋体">1.</span><span style="font-family: 宋体">预算单位与</span><span style="font-family: 宋体">中国建设银行</span><span style="font-family: 宋体">签订服务协议。</span></span></p><p style="margin: 0 0 0 13px;text-align: left;line-height: 31px;text-indent: 14px;-ms-layout-grid-mode: char"><span style="font-size: 14px"><span style="font-family: 宋体">2.</span><span style="font-family: 宋体">预算单位工作人员申请办理信用卡。</span></span></p><p style="