nt-family: 宋体\\">“建行财富”系列理财产品是中国建设银行财富管理与私人银行部为满足私人银行客户、高资产净值客户的多样化理财需求而推出的。</span> &nbsp;</span></p><p style=\\"text-align: left;line-height: 31px;text-indent: 28px\\"><span style=\\"font-size: 14px\\"><span style=\\"font-family: Calibri\\">&nbsp; </span> </span> </p><p style=\\"text-align: left;line-height: 31px;text-indent: 28px\\"><span style=\\"font-size: 14px\\"><span style=\\"font-family: 宋体\\">“建行财富”系列理财产品目标客户群体为具有较高金融资产，愿意追求较高收益并能承受相应风险的私人银行客户和高资产净值客户。产品由建行专业投资团队设计并进行投资操作，通过完善的风险控制体系有效降低产品风险。</span> &nbsp;</span></p><p style=\\"text-align: left;line-height: 31px;text-indent: 28px\\"><span style=\\"font-size: 14px\\"><span style=\\"font-family: Calibri\\">&nbsp; </span> </span> </p><p style=\\"text-align: left;line-height: 31px;text-indent: 28px\\"><span style=\\"font-size: 14px\\"><span style=\\"font-family: 宋体\\">“建行财富”系列理财产品多具有收益高、风险可控、起点较高的特点。根据产品结构不同可分为债券类、信托贷款类、新股申购类、股权投资类和证券投资类等类别系列产品。</span> &nbsp;</span></p><p style=\\"text-align: left;line-height: 31px;text-indent: 28px\\"><span style=\\"font-family: Calibri;font-size: 14px\\">&nbsp;</span> </p><p><img src=\\"http://img.baidu.com/hi/jx2/j_0007.gif\\"/></p><p><img src=\\"/ueditor/php/upload/image/20170609/1496988543728236.png\\"/></p><p><img src=\\"/ueditor/php/upload/image/20170609/1496988590667022.png\\"/></p><p><img src=\\"/ueditor/php/upload/image/20170609/1496988549897035.png\\"/></p><p><br/></p>'' WHERE ( raid=217 )', NULL, NULL, NULL),
